static int yy_init_globals (void)
{
        /* Initialization is the same as for the non-reentrant scanner.
     * This function is called from csql_yylex_destroy(), so don't allocate here.
     */

    (yy_buffer_stack) = 0;
    (yy_buffer_stack_top) = 0;
    (yy_buffer_stack_max) = 0;
    (yy_c_buf_p) = (char *) 0;
    (yy_init) = 0;
    (yy_start) = 0;

/* Defined in main.c */
#ifdef YY_STDINIT
    csql_yyin = stdin;
    csql_yyout = stdout;
#else
    csql_yyin = (FILE *) 0;
    csql_yyout = (FILE *) 0;
#endif

    /* For future reference: Set errno on error, since we are called by
     * csql_yylex_init()
     */
    return 0;
}

/* csql_yylex_destroy is for both reentrant and non-reentrant scanners. */
int csql_yylex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		csql_yy_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		csql_yypop_buffer_state();
	}

	/* Destroy the stack itself. */
	csql_yyfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * csql_yylex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

